import React from 'react';
import PropTypes from 'prop-types';

const bgImage = (props) => {
    return <div style={{ backgroundImage: `url(./images/${props.imageName}.png` }} />
  }

bgImage.propTypes = {
    imageName: PropTypes.string.isRequired
  };

export default bgImage;
